y hot flavor.	https://www.foodista.com/recipe/J3VSRLHM/chicken-and-white-bean-chili	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	chicken\nwater\nchicken base\nbay leaf\nyellow onion\nyellow bell pepper\ngarlic cloves\nflour\ncannellini beans\nchili powder\nground coriander\nground cumin\nfresh coriander\nheavy whipping cream\nsoured cream\nbell pepper\n
