247	Bing's Mango Salsa	\N	2021-04-27 14:29:20.920582	2021-04-27 14:29:20.920582	https://spoonacular.com/recipeImages/634992-556x370.jpg	45	Begin by cutting the mangoes into small 1.5cm by 1.5cm cubes.\nPlace the mangoes in a large mixing bowl. Grate the zest of 1 lime into the mangoes.\nSqueeze juice from half a lime into the mangoes. Add more lime juice to taste if required later.\nChop a bunch of coriander leaves (or use mint leaves if you hate the taste of coriander) into fine bits.\nAdd the chopped coriander to the mango mixture.\nStir well to combine. In fact, Suvarna recommended to stir well after the addition of every ingredient.\nCut the shallots or red onion into very thin slices.\nAdd the sliced shallots or red onion to the mango mixture and stir well to combine.\nAdd 1/2 teaspoon of salt or to taste.\nAdd 1/2 teaspoon of black pepper or to taste.\nAdd 1 teaspoon of sugar or to taste.\nStir well to combine and do a taste test. Add lime juice, sugar, salt or pepper as necessary to get a nice savoury sweet tangy flavour.\nFinally add the chopped chillis. Add according to your own heat tolerance. Some chillis are more spicy than others so add a little at a time till you acquire the desired spiciness. Stir well to combine.\nCover the bowl with cling wrap and place bowl in the fridge for at least 1/2 hour for the flavours to combine.\nKeep the mango salsa chilled till ready to serve.	https://www.foodista.com/recipe/84DB7TTN/bing-s-mango-salsa	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	mangoes\nlime zest\njuice of lime\nmint leaves\nred onion\nsalt\nblack pepper\nsugar\nchilli\n
248	Buckwheat Galette With An Egg	\N	2021-04-27 14:29:20.927544	2021-04-27 14:29:20.927544	https://spoonacular.com/recipeImages/636393-556x370.jpg	45	Place all of the ingredients, save the last 2 eggs, in a blender and whisk until combined. Pour into a sealable container and set into the fridge overnight.\nIn the morning, take your batter out from the fridge and let it sit for about 30 minutes to an hour. Pour about a tablespoon of milk to it and stir around.\nPlace a crepe pan on the burner (over medium-high heat) and melt a pat of butter in it (you can use a silicone brush to coat the pan).\nPour 1/4 cup of batter into the pan and tilt it to swirl the batter around until it coats the pan. Your first crepe is always going to be experimental. The fresh butter might make it a little clumpy or bubbly and it might not cover the pan properly--don't worry, you'll get into the swing of things after 1-2 tries.\nCook for about one minute or so. Use a spatula to lift an edge--if it's slightly golden, it's time to flip. Once you flip, cook for another 45 seconds or so. The amount of time that you cook the galette depends on many factors: your stove, the type of pan you're using, how thick the batter is, etc. You might also need to adjust the temperature--my crepe pans work best on medium-high heat, but this might be too high for your stove and could burn the crepes. Start with medium heat and increase or decrease, depending on how long the crepes are cooking for. My best advice is to lightly lift the edge of the galette to see if it's starting to change color before flipping. The edges will usually be slightly crisped.\nI usually make about 2-3 galettes before using my silicone brush to add a little more butter to the pan. I like to use the brush because it guarantees even coverage and never creates big clumps of butter that cause the batter to curl in places. The galettes should peel off the pan easily.\nTo keep the galettes warm as you cook more, here's a trick: set a big pot of water on a nearby skillet. Top with a large plate and bring to a boil. Place the done galettes on the plate--the boiling water underneath keeps the plate warm.\nSo, considering this recipe makes about 10 galettes--that means two people could each eat 4 galettes on their own (or with a swipe of jam or Nutella and some berries on the side) and each have a galette topped with an egg.\nWhen you're done making all of the galettees, place one back onto your crepe pan. Carefully crack one egg into the center. Use a fork to sort of spread the egg whites around the entire galette (but be careful to not disturb the yolk!). Salt and pepper. At this time, you could also throw in some cheese--shaved Parmesan, or maybe some Gruyere. When the whites have thickened and are universally white, use a spatula to lift the sides of the crepes and gently fold over as you would an envelope, but leave a nice center hole for the yolk. Slide your spatula under and place on a plate.	https://www.foodista.com/recipe/QF2D46MW/buckwheat-galette-with-an-egg	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	milk\nsugar\nsea salt\nbutter\nbuckwheat flour\nwhite whole wheat flour\neggs\neggs\n
