l syrup has been added, turn mixer to high and beat till thick, fluffy and just barely warm, about 7 minutes.  Fit a 16" piping bag with a 1M Wilton tip; spoon frosting into bag and pipe onto cupcakes making high mounds of frosting.</li><li>GARNISHES:  Place chocolate into one bottom corner of a resealable plastic bag.  Microwave on high about 30 seconds.  Continue microwaving on high at 10-second intervals until chocolate is melted.  Very carefully cut the tiniest corner to make a very small hole through which the chocolate may be drizzled onto the frosting.  Lightly sprinkle peanuts over cupcakes.</li><li>TIME-SAVING TIPS:  Instead of making peanut butter filling, just use Peanut Butter & Co.'s White Chocolate Wonderful Peanut Butter.  If you're not lactose intolerant, you could use a cake mix for the cupcakes, but you will have to double the other ingredients.</li></ol>	http://www.foodista.com/recipe/7PSYMB8V/dairy-free-cocoa-cupcakes-with-peanut-butter-filling-marshmallow-frosting	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	baking powder\nbaking soda\nbittersweet chocolate\ncanola oil\nchocolate\ncoffee\ncorn syrup\ncream of tartar\ncreamy peanut butter\ndutch process cocoa powder\negg\negg whites\ngranulated sugar\ngranulated sugar\nlight brown sugar\nmaple syrup\nroasted peanuts\nsalt\nsalt\nsoy milk\nsoy milk\nsugar\nunbleached flour\nvanilla extract\nvanilla extract\nwater\n
