t 15 minutes. Serve with a dollop of crema or sour cream and your favorite side dish.	https://www.foodista.com/recipe/XXGS8CCC/enchiladas-verdes-green-enchiladas	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	skinless boneless chicken breast\nchili peppers\ncanola oil\nbuttermilk\nflour\nwhite onion\nwhite corn tortillas\ncheese\nqueso fresco\ncrema\nsalt\nwater\n
