nother pan, drop the butter into it and cook it on medium until it turns a beautiful golden brown and gives off a lovely nutty smell. At this point you'll turn the heat down just a notch and add in your garlic.</li><li>Now drop in your chopped basil, give it a swirl or two to let the basil wilt and your butter sauce is ready to rumble.</li><li>Drain your cooked up ravioli, dump them in the butter sauce and get them good and coated.</li><li>Serve them up with a little grated Parmesan or Romano over the top.</li></ol>	http://www.foodista.com/recipe/FM8XPRRP/prosciutto-and-mushroom-ravioli-with-basil-browned-butter-sauce	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	all purpose flour\nbutter\nbutter\neggs\nfresh basil\ngarlic\nmushrooms\nonion\noregano\nprosciutto\nsalt\nspinach\n
