l the oil is about 2-3 inches deep.</li><li>Heat oil to 375 degrees.</li><li>Once oil is hot, drop in the dough  4-5 at a time and turn frequently.</li><li>Allow to fry for 2-3 minutes, or until a lovely golden dark brown.</li><li>Transfer the beignets to a drain on a paper towel lined plate.</li><li>Add some powdered sugar to the brown paper bag and drop in 3-4 beignets.</li><li>Close the bag and shake until the beignets are completely covered in powdered sugar.</li><li>Serve warm with the dipping sauces.</li></ol>	http://www.foodista.com/recipe/F8B6XBB4/powdered-buttermilk-beignets-with-raspberry-and-chocolate-dipping-sauce	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	active yeast\nbaking soda\nbread flour\nbuttermilk\ncanola oil\ngolden syrup\nhalf n half\nmilk\npowdered sugar\nraspberries\nraspberry jam\nsalt\nsemi sweet chocolate chips\nsugar\nwhite flour\n
