753	Caramel Apple-Brownie Cheesecake	\N	2021-04-27 14:56:47.352946	2021-04-27 14:56:47.352946	https://spoonacular.com/recipeImages/636989-556x370.jpg	45	<ol><li>Preheat oven to 350F (180 C).  Bake pecans in a single layer in a shallow pan for about 7-8 minutes or until lightly toasted and fragrant, stirring halfway through.Remove from oven, let cool down, and chop.  Reserve.</li><li>Reduce oven temperature to 325F (about 160 C). Grease and flour a 9-inch (22.5 cm) springform pan. Sprinkle pecans over bottom of the prepared pan and reserve.</li><li>In a heavy-duty electric stand mixer, beat cream cheese, granulated sugar, and vanilla at medium speed until well-blended and smooth.  Add 3 eggs (1 at a time), beating after  each addition until just blended.  Reserve.</li><li>In a separate large bowl, whisk together brown sugar, melted butter, and remaining egg until blended.  Then stir in the flour, cinnamon, baking powder, and salt.  Add the peeled and diced apples to the mixture and stir gently.  Spoon batter into prepared pan.  Carefully spoon cream cheese mixture over batter.</li><li>Bake at 325F ( about 160 C) for 70 minutes or until set.  Remove from oven, and gently run a knife around outer edge of cheesecake to loosen from sides of pan but do NOT remove sides of pan.  Cool completely in pan on a wire rack  for about 2 hours.  Remove side of the pan and transfer to a serving plate.</li><li>Meanwhile, prepare Caramel Apple Topping and Caramel Sauce.  Spoon topping over cheesecake; drizzle with 1/2 cup Caramel Sauce.  Reserve 1 cup Caramel Sauce to drizzle over the cheesecake later if you have not served the whole dessert at once.</li><li>For the Caramel Apple Topping: In a large skillet over medium heat, melt the butter; then, add both the sugar and lemon juice.  Cook, stirring constantly with a long-handled wooden spoon, for 5 to 6 minutes or until mixture turns a light golden brown.  Add the apple wedges and cook, stirring often, for 15 to 18 additional minutes or until apples are tender and caramelized.  Remove from heat and let cool for 20 minutes.</li><li>Meanwhile, prepare Caramel Apple Topping and Caramel Sauce.  Spoon topping over cheesecake; drizzle with 1/2 cup Caramel Sauce.  Reserve 1 cup Caramel Sauce to drizzle over the cheesecake later if you have not served the whole dessert at once.</li><li>For the Caramel Sauce: In a medium saucepan over medium-high heat, bring the brown sugar, butter, whipping cream, and honey to a boil, stirring constantly; then, boil  stirring constantly for 2 minutes.  Remove from heat, stir in the vanilla, and cool 15 minutes before serving.</li></ol>	http://www.foodista.com/recipe/GL53TRMC/caramel-apple-brownie-cheesecake	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	apples\nbaking powder\nbrown sugar\nbutter\ncream cheese\neggs\nflour\ngranulated sugar\nground cinnamon\npecans\nsalt\ntart apples\nvanilla extract\n
754	Turkey Sausage, Chard & Sweet Potato Breakfast Scramble	\N	2021-04-27 14:56:47.4037	2021-04-27 14:56:47.4037	https://spoonacular.com/recipeImages/664054-556x370.jpg	45	<ol><li>In a medium-sized skillet, heat about two teaspoons of olive oil on medium heat. Add the chopped sweet potato and saut 3 or 4 minutes before adding a little liquid and covering. In about 2 minutes, check to see if the liquid has burned off. If it has, add a little more and cover again. Repeat this several times until the sweet potato is soften, but still al dente. Add the mushrooms and the chopped chard stems. Saut another 3 to 5 minutes and add additional liquid if necessary.</li><li>Move the veggies to one side of the skillet with a wooden spoon and add the ground breakfast sausage. Brown the meat and using the wooden spoon break it apart. Continue sauting until the sausage is cooked all the way through.</li><li>Immediately add the green onion and chard leaves. Allow to steam for about 30 seconds before pouring the scrambled egg mixture evenly over the meat and veggies. This is where the technique comes in. Avoid the temptation to stir. Simply allow the skillet to sit 2 to three minutes. Then, using a wooden spoon or spatula, begin flipping sections of egg and veggies (similar to how you would fold whipped egg whites into a cake batter, just gently fold the scramble onto itself). Once all sections have been flipped over, everything to sit and cook another 2 or 3 minutes. Repeat the flipping.  Continue doing this until the egg is no longer cooking to the skillet.</li><li>Serve with your favorite toppings!</li></ol>	http://www.foodista.com/recipe/S3LTQRHW/turkey-sausage-chard-sweet-potato-breakfast-scramble	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	baby bella mushrooms\nbreakfast sausage\nchard\neggs\ngreen onion\nolive oil\nsweet potato\nwater\n
755	Lemon Quick Bread	\N	2021-04-27 14:56:47.414651	2021-04-27 14:56:47.414651	https://spoonacular.com/recipeImages/649755-556x370.jpg	45	<ol><li>Preheat oven to 350</li><li>Beat yogurt, sugar, eggs, vanilla and lemon extract until blended</li><li>Stir together flour, lemon peel, baking powder, baking soda and salt. Add to yogurt mixture,mix just until blended. Spoon batter into a greased and floured 9- x 5-inch loaf pan or 3 mini loafs.</li><li>Bake for 50 minutes to 1 hour for 1 large loaf or 30  35 minutes for 3 mini loafs, or until a toothpick inserted into center comes out clean, shielding with aluminum foil after 50 minutes to prevent excessive browning.</li><li>To make glaze:</li><li>In a small sauce pan add sugar and lemon juice, stir until dissolved and clear. While the cake is still warm, pour the lemon-sugar mixture over the cake and allow it to soak in (a pastry brush works great for this, as does using a toothpick to make tiny holes that draw the syrup in better).</li><li>Cool in pan on a wire rack 10 minutes; remove from pan to wire rack. Then eat!!!!</li><li>Calories per slice:  111,  Fat:  .02,  Cholesterol:  0,  Sodium:  137,  Potassium:  32, Carbs:  23,  Fiber:  1.3,  Sugar:  10.3,  Protein:  3.9</li></ol>	http://www.foodista.com/recipe/3G7KLCH7/lemon-quick-bread	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	0% fat greek yogurt\nbaking powder\nbaking soda\negg substitute\ngranulated sugar\nlemon extract\nlemon juice\nlemon peel\nsalt\nsugar\nvanilla extract\nwhole wheat pastry flour\n
756	Loaded Baked Potato Soup	\N	2021-04-27 14:56:47.464301	2021-04-27 14:56:47.464301	https://spoonacular.com/recipeImages/715562-556x370.jpg	60	<ol><li>Place a large pot of water on the stove and add in the peeled and cubed potatoes. Get the water up to a boil, and then boil for 20 minutes, or until potatoes are cooked. Remove from heat and drain water. Place to the side.</li><li>In a medium pot over medium-high heat melt butter and sautee onion for 6 minutes. Add in the flour and using a whisk, mix well for 30 seconds to one minute.</li><li>Gradually start whisking in the milk, about  cup to a cup at a time, constantly stirring. You want to keep whisking and adding milk and stirring. Bring to a boil, and then turn heat down to medium and allow the mixture to simmer for 8-10 minutes until thickened.</li><li>Stir in the potatoes and cook for an additional 5 minutes. Add in the cheese, salt and pepper, sour cream and stir well. Remove from heat and allow to cool slightly before serving.</li><li>Top with additional sour cream, cheese, and bacon bits if desired.</li></ol>	http://www.pinkwhen.com/loaded-baked-potato-soup/	Jen West	bacon bits\nbaking potatoes\nbutter\nflour\nmilk\nsalt and pepper\nshredded cheddar cheese\nsour cream\nwhite onion\n
757	Curried Butternut Squash and Apple Soup	\N	2021-04-27 14:56:47.484201	2021-04-27 14:56:47.484201	https://spoonacular.com/recipeImages/641057-556x370.jpg	45	Get ready two small saucepans.\nIn one have together 1/2 of the squash and 1/2 of the apple  bring to a simmer, and simmer until just tender when pierced with a fork.\nIn the other, add in the rest of the vegetables along with 1 cup of water  bring this to a rolling boil, reduce to a simmer, and simmer until very very tender. When very tender, remove the vegetables from the heat, and blend these vegetables together (without draining) with the Braggs, spices, sriracha and the additional 1/2 cup water.\nMix the blended part of the soup with the simmered squash and apples. Mix in the cubed tofu, gently re-heat and serve.	https://www.foodista.com/recipe/FKQCYKYR/curried-butternut-squash-and-apple-soup	Foodista.com  The Cooking Encyclopedia Everyone Can Edit	cauliflower\nbutternut squash\napple\nwater\nbraggs liquid aminos\ncurry powder\nginger powder\nsriracha\ntofu\n
